import './App.css';
import Modalbutton from './components/modalbutton';
import Header from './components/header';
import Footer from './components/footer';
import Button from '@material-ui/core/Button';

class App extends Component {

  buttonHandler = (buttonName) => {
    alert("Button handler " + buttonName.currentTarget.value)
  }

  render() {
    const gf = require('./images/goldfinger.jpg');
    return (

      <div className="outerdiv">

        <div class="container">
          <div className="maindiv">

            <div className="row banner">
              <Header />
            </div>
            <div className="row">

              <div className="col-sm">
              </div>

              <div className="col-sm centered">
                <Modalbutton
                  buttonHandlerFunction={this.buttonHandler}
                />
              </div>

              <div className="col-sm">
              </div>

            </div>


            <div className="row">
            <div className="productname">
            Goldfinger
            </div>
            </div>
            <div>
            <div>
            <img className="thumbnail" src={gf} alt="goldfinger"></img>
            </div>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas et metus.
            </div>

            <div className="row">
            <div className="col-sm">
            <Footer />
            </div>
            </div>

          </div>

        </div>
      </div>
    );
  }
}

export default App;
